import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';
import styled from 'styled-components';
import vicar_sgv from "../../assets/images/vicar_sgv.svg"
import "../styles.css"

const StyledNavLink = styled.a`
text-align: justify;
padding: 5px 10px;
margin: 0 5px;
font-weight: 600px;
text-decoration: none;`;



const Logo = styled.img`
  height: 90px;
  width: 90px;
  margin:20px;
`;

const StyledCabecalho = styled.nav`
  background-color: #181820;
  display: flex;
  justify-content: space-between;
  padding: 0 15vw;
  
  align-items: center;
`;

class Cabecalho extends React.Component {
    render(){
        return (
            <StyledCabecalho>
            <React.Fragment>
                <Logo src={vicar_sgv} alt="Logo Vicar"/>
                
                <StyledNavLink><NavLink className="pedido" to="/pedido">Pedido</NavLink></StyledNavLink>
                <StyledNavLink><NavLink className="cardapio" to="/cardapio">Card√°pio</NavLink></StyledNavLink>
                <StyledNavLink><NavLink className="cliente" to="/cliente">Cadastro de Cliente</NavLink></StyledNavLink>
                <StyledNavLink><NavLink className="carrinho" to="/adicionar"><i class="bi-cart-plus"></i></NavLink></StyledNavLink>
                
            </React.Fragment>
            </StyledCabecalho>
        );
    }
}
export default Cabecalho;
